import React, { useState } from "react";

export default function ExportImportComponent({
  headers,
  data,
  start,
  end,
  setHeaders,
  setData,
  setStart,
  setEnd,
}) {
  function handleExport() {
    var obj = new Object();
    obj.headers = {headers};
    obj.age = 32;
    obj.married = false;
    var jsonString = JSON.stringify(obj);
  }
  return (
    <div className="button_group">
      <button className="create_matrix_btn exp " id="exp">
        Экспортировать
      </button>
      <button className="create_matrix_btn imp" id="exp">
        Импортировать
      </button>
    </div>
  );
}
